function AgregarNuevoEjercicioRutina({AgregarEjercicio}) {
    const [ejercicios,setEjercicios] = useState([])
    const cargarCbx = ()=>{
        axios.get('https://localhost:7165/api/Ejercicio')
        .then(response => response.data.myObject.forEach(element => {
            {setEjercicios(response.data.myObject);}
        }))
        .catch(error => console.error('Error:', error));
    }


  return (
   
        <Form.Select aria-label="Default select example">
          <option>Open this select menu</option>{ 
          
          ejercicios.map((ejercicio) =>(
            <option value={ejercicio.id_ejericio}>{ejercicio.nombreEjecicio}</option>      
            )
            )  
          }
          
        </Form.Select>
      );
    }
    
  

export default AgregarNuevoEjercicioRutina
